typedef struct {
	f32 x;
	f32 y;
} Point;

typedef struct {
	bool moving;
	bool is_on_floor;
	Point pos;
	Point spd;
} Player;

Map *bga;
Sprite* cup_obj;

Player plr;

s16 camPosX = -1;
s16 camPosY = -1;

bool paused = FALSE;

bool checkCollision(s16 x, s16 y){
	plr.is_on_floor = FALSE;
	
	s16 y_tile = y >> 3;
	s16 x_tile = x >> 3;
	
	u8 player_width = 4;
	u8 player_height = 4;
	
	s16 leftTile = x_tile;
	s16 rightTile = x_tile+player_width;
	s16 topTile = y_tile;
	s16 bottomTile = y_tile+player_height;
	
	for(s16 i=leftTile; i<=rightTile; i++)
	{
		for(s16 j=topTile; j<=bottomTile; j++)
		{
			if(level[j][i] == 0) {
				if(j == bottomTile){
					plr.is_on_floor = TRUE;
				}
				return FALSE;
			}
		}
	}
	return TRUE;
}

void moveEntity(){
	s16 posX = fix32ToInt(plr.pos.x);
	s16 posY = fix32ToInt(plr.pos.y);
	
	s16 testPosX;
	s16 testPosY;
	
	s16 spdX = fix32ToInt(plr.spd.x);
	s16 spdY = fix32ToInt(plr.spd.y);
	
	if(checkCollision(posX+spdX, posY+spdY)) {
		posX += spdX;
		posY += spdY;
	} else {
		if (spdX) {
			testPosX = posX;
			if (spdX > 0) {
				for(u8 i=1;i<spdX;i++){
					testPosX++;
					if(checkCollision(testPosX, posY)) {
						posX = testPosX;
					} else {
						break;
					}	
				}
			} else {
				for(u8 i=spdX;i>0;i++){
					testPosX--;
					if(checkCollision(testPosX, posY)) {
						posX = testPosX;
					} else {
						break;
					}	
				}
			}
		}
		if (spdY) {
			testPosY = posY;
			if (spdY > 0) {
				for(u8 i=1;i<spdY;i++){
					testPosY++;
					if(checkCollision(posX, testPosY)) {
						posY = testPosY;
					} else {
						break;
					}
				}
			} else {
				for(u8 i=spdY;i>0;i++){
					testPosY--;
					if(checkCollision(posX, testPosY)) {
						posY = testPosY;
					} else {
						break;
					}
				}
			}
		}
	}
	
	plr.pos.x = FIX32(posX);
	plr.pos.y = FIX32(posY);
	
}

void setCameraPosition(s16 x, s16 y)
{
    if ((x-160 != camPosX) || (y-120 != camPosY))
    {
        camPosX = x-160;
        camPosY = y-120;
		
		if (camPosX < 0){
			camPosX = 0;
			
		} else if (camPosX > MAX_X-320) {
			camPosX = MAX_X-320;
		}		
		if (camPosY < 0){
			camPosY = 0;
		} else if (camPosY > MAX_Y-120) {
			camPosY = MAX_Y-120;
		}	
		
		SPR_setPosition(cup_obj, x-camPosX, y-camPosY);

        MAP_scrollTo(bga, camPosX, camPosY);
    }
}

void handleInput()
{
    u16 value = JOY_readJoypad(JOY_1);


	
    if (!paused && !plr.moving)
    {
		
		plr.spd.x = 0;
		
		if(!plr.is_on_floor){
			plr.spd.y += FIX32(1);
		} else {
			plr.spd.y = 0;
		}
		
        if (value & BUTTON_RIGHT)
        {
			plr.spd.x = FIX32(5);
		}
        else if (value & BUTTON_LEFT)
        {
			plr.spd.x = FIX32(-5);
		}
        if (value & BUTTON_UP)
        {
			if(plr.is_on_floor){
				//XGM_startPlayPCM(64, 15, SOUND_PCM_CH2);
				plr.spd.y = FIX32(-10);
			}
        }
    }
}

int main()
{
	plr.moving = FALSE;
	plr.is_on_floor = FALSE;
	plr.pos.x = FIX32(160);
	plr.pos.y = FIX32(950);
	plr.spd.x = 0;
	plr.spd.y = 0;
	
	//XGM_setPCM(64, jump_sfx, sizeof(jump_sfx));
	
	XGM_startPlay(xgm_music);
	
	
	u16 ind;
	ind = TILE_USER_INDEX;
	
    VDP_loadTileSet(&bga_tileset, ind, DMA);
	bga = MAP_create(&bga_map, BG_B, TILE_ATTR_FULL(0, FALSE, FALSE, FALSE, TILE_USER_INDEX));
	
	PAL_setPalette(0, palette_all.data, DMA);
	SPR_init();
	PAL_setPalette(PAL3, spr_cup.palette->data, DMA);
	setCameraPosition(fix32ToInt(plr.pos.x),fix32ToInt(plr.pos.y));
	setCameraPosition(fix32ToInt(plr.pos.x)-1,fix32ToInt(plr.pos.y)-1);
	
	cup_obj = SPR_addSprite(&spr_cup, fix32ToInt(plr.pos.x), fix32ToInt(plr.pos.y), TILE_ATTR(PAL3, 0, FALSE, FALSE));
	
	SPR_update();
	SYS_doVBlankProcess();

    while(1)
    {
		SPR_update();
		handleInput();
		moveEntity();
		
		VDP_showFPS(FALSE);
		setCameraPosition(fix32ToInt(plr.pos.x),fix32ToInt(plr.pos.y));
        
		SYS_doVBlankProcess();
    }
	
    return (0);
}
